import React from 'react'
import xIcon from '../assets/images/x-2.png'
import IM1 from '../assets/images/IM1.png'
import IM10 from '../assets/images/IM10.png'
import IM11 from '../assets/images/IM11.png'
import IM12 from '../assets/images/IM12.png'
const team = () => {
  return (
    <div>
      <>
  <div id="team" />
  <div className="team-section style-four pt-110 pb-100">
    <div className="container">
      <div className="row">
        <div className="col-lg-12">
          <div className="dreamit-section-title two text-center pb-20">
            <div className="dreamit-section-sub-title">
              <h5>
                {" "}
                <img src={x2} alt="" /> Our Team
              </h5>
            </div>
            <div className="dreamit-section-main-title res-align">
              <h1> Our Index Managers </h1>
            </div>
            <div className="dreamit-section-content-text res-align">
              <p className="ptext res-align">
                The XPO Team combines a passion for esports, industry experise
                &amp; proven record in finance, development, marketing &amp;
                licensing.
              </p>
            </div>
          </div>
        </div>
      </div>
      <style
        dangerouslySetInnerHTML={{
          __html:
            "
	 .single-team-box-two {
  position: relative;
  display: inline-block;
  overflow: hidden;
}

.single-team-thumb {
  position: relative;
	opacity: 0.9;
}

.single-team-thumb img {
  width: 100%;
 /* opacity: 0.5;*/
  transition: opacity 0.3s ease, transform 0.3s ease;
	height: 190px;
	cursor: pointer;
	border-radius: 8px;

}

.single-team-thumb:hover img {

  transform: scale(1.05);  
}

.overlay {

	position: absolute;
    bottom: 14px;
    width: 50%;
    height: 25%;
    display: flex
;
    flex-direction: column;
    justify-content: end;
    align-items: center;
    color: white;
    background: #21407091;
    opacity: 1;
    z-index: 1;
    transition: opacity 0.3s ease;
    padding-bottom: 1px;
    border-radius: 24px;
    right: 60px;
	cursor: pointer;
}


.overlay span {
  margin: 0;
	opacity: 0.7;
	font-size: 13px !important;
}
.overlay h3{font-size: 12px !important; line-height: 0.1; letter-spacing: 0.8}
.single-team-thumb:hover .overlay {
  opacity: 100%;
  z-index: 999;  
}





		.overlay  .cltext {
  margin: 0 !important;
	opacity: 0.7 !important;
	font-size: 11px !important;
}

		.dugu{opacity: 0.5;}
		.dugu:hover{opacity: 1;}


		@media screen and (max-width: 768px) {	
		.overlay {
    position: absolute;
    bottom: 41px;
    width: 35%;
    height: 25%;
    display: flex;
    flex-direction: column;
    justify-content: end;
    align-items: center;
    color: white;
    background: #21407091;
    opacity: 1;
    z-index: 1;
    transition: opacity 0.3s ease;
    padding-bottom: 1px;
    border-radius: 24px;
    right: 139px;

}

		}


	@media screen and (max-width: 576px) {	
		.overlay {
    position: absolute;
    bottom: 40px;
    width: 35%;
    height: 25%;
    display: flex;
    flex-direction: column;
    justify-content: end;
    align-items: center;
    color: white;
    background: #21407091;
    opacity: 1;
    z-index: 1;
    transition: opacity 0.3s ease;
    padding-bottom: 1px;
    border-radius: 24px;
    right: 90px;
}

		} 
	  "
        }}
      />
      <div className="row pt-30 m-auto">
        <div className="col-lg-3 col-md-6 mb-4 tcenter ">
          <div className="single-team-box-two">
            <div className="single-team-thumb">
              {" "}
              <img src="assets/images/IM1.png" alt="" className="dugu" />{" "}
            </div>
          </div>
          <div className="overlay">
            <h3>Vladlen Maslov</h3>
            <span>Deriva Forex Index</span>{" "}
          </div>
        </div>
        <div className="col-lg-3 col-md-6 mb-4 tcenter ">
          <div className="single-team-box-two">
            <div className="single-team-thumb">
              {" "}
              <img src="assets/images/IM10.png" alt="" className="dugu" />{" "}
            </div>
          </div>
          <div className="overlay">
            <h3>Nikita Pirogov</h3>
            <span>Halloween Trade</span>{" "}
          </div>
        </div>
        <div className="col-lg-3 col-md-6 mb-4 tcenter ">
          <div className="single-team-box-two">
            <div className="single-team-thumb">
              {" "}
              <img src="assets/images/IM11.png" alt="" className="dugu" />{" "}
            </div>
          </div>
          <div className="overlay">
            <h3>Alevtina Pavlova</h3>
            <span>Profit Magnet</span>{" "}
          </div>
        </div>
        <div className="col-lg-3 col-md-6 mb-4 tcenter ">
          <div className="single-team-box-two">
            <div className="single-team-thumb">
              {" "}
              <img src="assets/images/IM12.png" alt="" className="dugu" />{" "}
            </div>
          </div>
          <div className="overlay">
            <h3>Ludmila Gorbunov</h3>
            <span>Dimond FX Index</span>{" "}
          </div>
        </div>
      </div>
      <div id="blog" />
    </div>
  </div>
</>

    </div>
  )
}

export default team
